//@ts-nocheck
import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import BarChart from './BarChart';
import PieDonutChart from './PieDonutChart';
import RadialChart from './RadialChart';

const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const CardSection3 = ()=>{
return (
  <Row>
    <Col md={8} sm={12}>
      <Card  ><div style={{height:"500px"}}><RadialChart/></div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}><PieDonutChart/></div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}><BarChart/></div></Card>
    </Col>

  </Row>
);
}

export default CardSection3;
